import React, { useEffect, useRef, useState } from "react";
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  ResponsiveContainer,
} from "recharts";

const VideoPanel = () => {
  const canvasRef = useRef<HTMLCanvasElement | null>(null);


  useEffect(() => {
    const socket = new WebSocket(`ws://${window.location.hostname}:8765`);
    socket.binaryType = "arraybuffer";

    socket.onmessage = (event) => {
      const bytes = new Uint8Array(event.data);
      const blob = new Blob([bytes], { type: "image/jpeg" });
      const url = URL.createObjectURL(blob);
      const img = new Image();
      img.onload = () => {
        const ctx = canvasRef.current?.getContext("2d");
        ctx?.drawImage(img, 0, 0, 640, 480);
        URL.revokeObjectURL(url);
      };
      img.src = url;
    };

    return () => socket.close();
  }, []);

  return (
    <div className="p-4 bg-white rounded-xl shadow-md">
      <h2 className="text-xl font-semibold mb-2">🎥 Monitoreo en Vivo</h2>
      <canvas
        ref={canvasRef}
        width="640"
        height="480"
        className="border rounded"
      />
    </div>
  );
};

const MetricPanel = () => {
  const [data, setData] = useState([
    { name: "Cuello", valor: 0 },
    { name: "Torso", valor: 0 },
    { name: "Desviación", valor: 0 },
  ]);

  useEffect(() => {
    const socket = new WebSocket(`ws://${window.location.hostname}:8765`);
    socket.onmessage = (event) => {
      try {
        const payload = JSON.parse(event.data);
        if (payload.cuello !== undefined && payload.torso !== undefined && payload.desviacion !== undefined) {
          setData([
            { name: "Cuello", valor: payload.cuello },
            { name: "Torso", valor: payload.torso },
            { name: "Desviación", valor: payload.desviacion },
          ]);
        }
      } catch (e) {
        // ignorar mensajes no JSON (como imágenes del video)
      }
    };
    return () => socket.close();
  }, []);

  return (
    <div className="p-4 bg-white rounded-xl shadow-md">
      <h2 className="text-xl font-semibold mb-2">📊 Indicadores Posturales</h2>
      <ResponsiveContainer width="100%" height={200}>
        <BarChart data={data}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Bar dataKey="valor" fill="#3b82f6" />
        </BarChart>
      </ResponsiveContainer>
    </div>
  );
};


const PatientInfoPanel = () => {
  return (
    <div className="p-4 bg-white rounded-xl shadow-md space-y-2">
      <h2 className="text-xl font-semibold mb-2">🧑‍⚕️ Información del Paciente</h2>
      <div>
        <p className="text-sm font-medium text-gray-600">Nombre:</p>
        <p className="text-lg font-semibold text-gray-800">Juan Pérez</p>
      </div>
      <div>
        <p className="text-sm font-medium text-gray-600">Edad:</p>
        <p className="text-lg font-semibold text-gray-800">32 años</p>
      </div>
      <div>
        <p className="text-sm font-medium text-gray-600">Diagnóstico:</p>
        <p className="text-lg font-semibold text-gray-800">Lumbalgia crónica</p>
      </div>
    </div>
  );
};

export default function App() {
  return (
    <main className="min-h-screen bg-gray-100 p-6 grid grid-cols-1 md:grid-cols-3 gap-6">
      <div className="col-span-2 space-y-4">
        <VideoPanel />
        <MetricPanel />
      </div>
      <PatientInfoPanel />
    </main>
  );
}
